import React from 'react';
import ProductContent from './ProductContent.js';
import ProductPicture from './ProductPicture.js';

const text = "Jiggling, like flying through the cafeteria..."

class ProductFace extends React.Component {
  render(){
    return <div className="ProductFace">
              <ProductPicture />
              <ProductContent content={text}/>
    </div>;
  }

}

export default ProductFace;
